import React from "react";
import { BrowserRouter, Switch, Route, Redirect } from "react-router-dom";

import ArticlesContainer from "./ArticlesContainer";

function App() {
  return (
    <BrowserRouter>
      <Layout>
        <Switch>
          <Route exact path="/" component={ArticlesContainer} />
        </Switch>
      </Layout>
    </BrowserRouter>
  );
}
export default App;
